USE drive;


SELECT * FROM users; 
SHOW CREATE TABLE users;
UPDATE users SET phone = CONCAT('+79', CEIL(RAND()*10000000));
UPDATE users SET location = CONCAT('{"latitude":"', FORMAT(54 + RAND()*2, 4),'", "longitude":"',  FORMAT(37 + RAND()*2, 4), '"}');
UPDATE users SET updated_at = CURRENT_TIMESTAMP WHERE created_at > updated_at;



SELECT * FROM profiles;



UPDATE rental SET updated_at = CURRENT_TIMESTAMP WHERE created_at > updated_at;


UPDATE cars SET location = CONCAT('{"latitude":"', FORMAT(54 + RAND()*2, 4),'", "longitude":"',  FORMAT(37 + RAND()*2, 4), '"}');
UPDATE cars SET model = CASE mark 
	WHEN 'Reno' THEN 'Capture' 
	WHEN 'Wolkswagen' THEN 'Polo'
	WHEN 'Hyindai' THEN 'Solaris'
	WHEN 'Mersedes' THEN 'GL'
	WHEN 'BMW' THEN '320i'
	END;  
UPDATE cars SET class_id = CASE mark 
	WHEN 'Reno' THEN 1 
	WHEN 'Wolkswagen' THEN 1
	WHEN 'Hyindai' THEN 2
	WHEN 'Mersedes' THEN 3
	WHEN 'BMW' THEN 4
	END;  
UPDATE cars SET car_number = CONCAT(
	(SELECT letter FROM f_letter ORDER BY RAND() LIMIT 1),
	CEIL(100+RAND()*899),
	(SELECT letter FROM s_letter ORDER BY RAND() LIMIT 1),
	77
	);
CREATE TEMPORARY TABLE f_letter (letter CHAR(1));
CREATE TEMPORARY TABLE s_letter (letter CHAR(2));





UPDATE car_repair SET updated_at = CURRENT_TIMESTAMP WHERE created_at > updated_at;



UPDATE car_services SET location = CONCAT('{"latitude":"', FORMAT(54 + RAND()*2, 4),'", "longitude":"',  FORMAT(37 + RAND()*2, 4), '"}');
UPDATE car_services SET updated_at = CURRENT_TIMESTAMP WHERE created_at > updated_at;




UPDATE routes SET waypoint = CONCAT('{"latitude":"', FORMAT(54 + RAND()*2, 4),'", "longitude":"',  FORMAT(37 + RAND()*2, 4), '"}');
UPDATE routes SET updated_at = CURRENT_TIMESTAMP WHERE created_at > updated_at;



UPDATE rental_time SET updated_at = CURRENT_TIMESTAMP WHERE created_at > updated_at;
UPDATE rental_time SET finish_mode = ADDDATE(start_mode, INTERVAL CEIL(10+RAND()*500) MINUTE);
